tener("click",(function(){g(),m(e,a),n.appendChild(function(){const n=document.createElement("section");return n.id="menu-section",n.innerHTML='\n  <h2 class="menu-h2">Menu</h2>\n  \n  <div class="menu-container">\n  \n  <div class="menu-box">\n  <h3 class="menu-title">Crêpes à la Buttermilk (Buttermilk Crêpes)</h3>\n  <p class="menu-description">\n  Delicate buttermilk crêpes served with a drizzle of luscious molasses and topped with our signature \n  sassafras-infused whipped cream. For an extra touch of freshness, \n  add a side of seasonal fruits.\n  </p>\n  </div>\n\n  <div class="menu-box">\n  <h3 class="menu-title">Sandwich de Poitrine de Bœuf Braisé (Braised Beef Brisket Sandwich)</h3>\n  <p class="menu-description">\n  Slow-smoked beef brisket, thinly sliced, accompanied by pickled okra, tomatoes, and wild onions, \n  all between slices of black bread.\n  Served with your choice of a side salad or crispy fried potatoes.\n  </p>\n  </div>\n\n  <div class="menu-box">\n  <h3 class="menu-title">Galettes aux Salsifis Doux et Saucisse (Sweet Fennel Pork Sausage & Buckwheat Cakes)</h3>\n  <p class="menu-description">\n  Galettes aux Salsifis Doux et Saucisse (Sweet Fennel Pork Sausage & Buckwheat Cakes) Cornmeal and molasses hotcakes infused \n  with sweet fennel pork sausage. \n  A delightful marriage of flavors that will leave you craving for more.\n  </p>\n  </div>\n\n  <div class="menu-box">\n  <h3 class="menu-title">Épaule de Sanglier Saisie à la Poêle (Pan-Seared Wild Boar Shoulder)</h3>\n  <p class="menu-description">\n  Succulent wild boar shoulder seasoned with cracked peppercorns and a rich red wine glaze. \n  Served alongside hot corn cakes and a side salad, \n  creating an exceptional medley of taste and texture.\n  </p>\n  </div>\n\n  <div class="menu-box">\n  <h3 class="menu-title">Crêpes à la Buttermilk</h3>\n  <p class="menu-description">\n  Delicate buttermilk crêpes served with a drizzle of luscious molasses and topped with our signature \n  sassafras-infused whipped cream. For an extra touch of freshness, \n  add a side of seasonal fruits.\n  </p>\n  </div>\n\n  <div class="menu-box">\n  <h3 class="menu-title">Ragoût d\'Agneau aux Carottes (Lamb Stew with Carrots)</h3>\n  <p class="menu-description">\n  Tenderized mutton stewed to perfection with carrots, celery, onions, and fragrant rosemary, enhanced by a \n  hint of black pepper. \n  Accompanied by two delectable sourdough biscuits.\n  </p>\n  </div>\n\n  <div class="menu-box">\n  <h3 class="menu-title">Caille Rôtie aux Herbes (Roasted Quails with Herbs)</h3>\n  <p class="menu-description">\n  A culinary masterpiece featuring two whole roasted quails, expertly stuffed with oregano and garlic. \n  Served alongside a medley of roasted beets, leeks, and potatoes.\n  </p>\n  </div>\n\n  <div class="menu-box">\n  <h3 class="menu-title">Sandwich au Jambon de Bœuf Salé (Corned Beef Sandwich)</h3>\n  <p class="menu-description">\n  Savory clove-rubbed corned beef accompanied by coleslaw, all embraced by delectable cowboy fry bread. \n  Served with your choice of a side salad or crispy fried potatoes.\n  </p>\n  </div>\n\n  <div class="menu-box">\n  <h3 class="menu-title">Club de Dinde Sauvage (Wild Turkey Club)</h3>\n  <p class="menu-description">\n  Thick cuts of succulent roasted wild turkey, topped with wild onions, lettuce, tomato, and a touch of mayo, \n  nestled between slices of artisanal black bread.\n  </p>\n  </div>\n\n  <div class="menu-box big">\n  <h3 class="menu-title big-h3"> Bon appétit!</h3>\n  </div>\n  \n  \n  </div>\n  \n  \n  \n  ',n}())}));const t=document.getElementById("gallery");t.addEventListener("click",(function(){g(),m(e,t),n.appendChild(function(){const n=document.createElement("div");return n.classList.add("gallery-container"),n.innerHTML='\n  <h2 class="gallery-h2">Gallery</h2>\n  <div class="mediaScroll">\n  <div class="img img-1"> </div>\n  <div class="img img-2"> </div>\n  <div class="img img-3"> </div>\n  <div class="img img-4"> </div>\n  <div class="img img-5"> </div>\n  <div class="img img-6"> </div>\n  <div class="img img-7"> </div>\n  <div class="img img-8"> </div>\n  </div>\n  ',n}())}));const o=document.getElementById("review");o.addEventListener("click",(function(){g(),m(e,o),n.appendChild(function(){const n=document.createElement("section");return n.id="review-section",n.innerHTML='\n  <div class="review-container">\n  \n  <div class="review-box">\n  <div class"review-heading-div">\n  <h3>Review 1</h3>\n  </div>\n  <div class="review-rating-div"> \n  <span>⭐⭐⭐⭐⭐</span> \n  </div>\n  <div class="review-text-div">\n  <p>"An enchanting escape to France! My experience at Restaurant C\'est La Vie was truly unforgettable. From the moment I stepped in, \n  the ambiance transported me to a cozy bistro in Paris. The menu selection was impressive, and each dish I tried was a masterpiece. \n  The escargot appetizer was delicate and perfectly seasoned, while the coq au vin left me speechless with its tender chicken and rich red wine sauce. \n  And don\'t even get me started on the crème brûlée - it was pure bliss! The attentive staff and impeccable service added to the overall charm of the evening.\n   I highly recommend Restaurant C\'est La Vie for anyone seeking an authentic French dining experience. Bravo!" </p>\n  </div>\n  </div>\n\n  <div class="review-box">\n  <div class"review-heading-div">\n  <h3>Review 2</h3>\n  </div>\n  <div class="review-rating-div"> \n  <span>⭐⭐⭐⭐⭐</span> \n  </div>\n  <div class="review-text-div">\n  <p>"A little piece of France in our neighborhood! Restaurant C\'est La Vie is a hidden gem. From the moment I tasted the escargot, \n  I knew I was in for a treat. The mains were equally impressive; the ratatouille had a burst of fresh flavors, and the beef bourguignon was melt-in-your-mouth tender. \n  The wine selection perfectly complemented our meal. The staff was attentive and accommodating, and they made us feel like valued guests throughout the evening. \n  I\'m so thrilled to have found this lovely restaurant, and I can\'t wait to bring more friends to share in this delightful experience!" </p>\n  </div>\n  </div>\n\n  <div class="review-box">\n  <div class"review-heading-div">\n  <h3>Review 3</h3>\n  </div>\n  <div class="review-rating-div"> \n  <span>⭐⭐⭐⭐⭐</span> \n  </div>\n  <div class="review-text-div">\n  <p>"If you want to feel like you\'re dining in the heart of France, look no further than Restaurant C\'est La Vie! \n  The moment I entered, I was greeted with warm smiles and the alluring aroma of fresh-baked baguettes. \n  The attention to detail in each dish was remarkable. I thoroughly enjoyed the bouillabaisse, bursting with fresh seafood and a delightful saffron-infused broth. \n  The flavors brought back memories of my trip to Marseille. The staff was not only knowledgeable about the menu but also eager to share interesting facts about French cuisine. \n  An exceptional culinary journey that I can\'t wait to embark on again!" </p>\n  </div>\n  </div>\n\n  <div class="review-box">\n  <div class"review-heading-div">\n  <h3>Review 4</h3>\n  </div>\n  <div class="review-rating-div"> \n  <span>⭐⭐⭐⭐⭐</span> \n  </div>\n  <div class="review-text-div">\n  <p>"Magical and romantic - that\'s how I would describe my evening at Restaurant C\'est La Vie. As a Francophile, I had high expectations, \n  and I must say, this place exceeded them all! The atmosphere was charming and had the perfect blend of elegance and coziness. \n  The onion soup was a warm hug in a bowl, and the duck confit was cooked to perfection with crispy skin and tender meat. \n  My partner and I couldn\'t resist sharing a slice of the divine raspberry tart for dessert. The flavors were simply divine. \n  It\'s evident that the chefs are passionate about their craft, \n  and it truly reflects in every dish. An absolute gem of a restaurant that I\'ll cherish in my memories forever." </p>\n  </div>\n  </div>\n  \n  </div>',n}())}));const i=documen